import React from 'react';
import { 
    ModalCard
  } from '@vkontakte/vkui';
import Icon28FavoriteCircleFillYellow from '@vkontakte/icons/dist/28/favorite_circle_fill_yellow';

export default class Prometay extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

        }

    }
    render() {
        return (
            <ModalCard
                id='prom'
                onClose={this.props.onClose}
                icon={<Icon28FavoriteCircleFillYellow width={72} height={72} />}
                caption="Прометей — особенный значок, выдаваемый агентам за хорошее качество ответов."
                actions={[{
                  title: 'Понятно',
                  mode: 'secondary',
                  action: () => {
                    this.props.onClose()
                  }
                }
                ]}
                
              />
        )
    }
}
